import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';

const LoginPage = () => {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const navigate = useNavigate();

  const onChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/auth/login', formData);
      localStorage.setItem('token', res.data.token);
      alert('Login successful!');
      navigate('/details');
    } catch (err) {
      alert('Error: ' + (err.response?.data?.msg || 'Please check your credentials. New accounts are created automatically upon first login.'));
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100 p-4">
      <div className="relative w-full max-w-5xl bg-black rounded-2xl shadow-2xl overflow-hidden grid lg:grid-cols-2">
        
        {/* Left Column: Image with Themed Background */}
        <div className="hidden lg:flex flex-col items-center justify-center p-12 bg-gradient-to-br from-purple-800 to-indigo-900 text-white text-center">
          <img 
            src="/images/brain-mri.png" // Ensure this path is correct
            alt="NeuroAssess Brain Scan" 
            className="w-full max-w-xs rounded-lg shadow-xl mb-6"
          />
          <h1 className="text-4xl font-extrabold tracking-tight mb-3">NeuroAssess</h1>
          <p className="text-xl font-light text-purple-200">Advanced Early Detection</p>
          <div className="mt-8 space-y-3 text-left w-full max-w-xs">
            <p className="flex items-center text-purple-100 text-lg"><span className="text-green-300 mr-3">✔</span> Comprehensive Patient Records</p>
            <p className="flex items-center text-purple-100 text-lg"><span className="text-green-300 mr-3">✔</span> Real-time Clinical Documentation</p>
            <p className="flex items-center text-purple-100 text-lg"><span className="text-green-300 mr-3">✔</span> Advanced AI Analysis</p>
          </div>
          <div className="mt-10 p-4 bg-purple-700 rounded-lg text-sm">
            <p className="font-semibold mb-2">Secure & Compliant</p>
            <span className="inline-block bg-purple-600 text-purple-100 px-3 py-1 rounded-full text-xs mr-2">HIPAA Compliant</span>
            <span className="inline-block bg-purple-600 text-purple-100 px-3 py-1 rounded-full text-xs">256-bit Encryption</span>
          </div>
        </div>

        {/* Right Column: Login Form */}
        <div className="p-8 sm:p-12 flex flex-col justify-center">
          <div className="text-center lg:text-left mb-8">
            <h1 className="text-4xl font-extrabold text-gray-800 mb-2">Welcome Back</h1>
            <p className="text-gray-600 text-lg">Please sign in to access your assessment system.</p>
          </div>

          <form onSubmit={onSubmit} className="space-y-6 max-w-sm mx-auto lg:mx-0">
            <div>
              <label htmlFor="email" className="block text-base font-medium text-gray-700">Email Address</label>
              <input 
                type="email" 
                name="email" 
                onChange={onChange} 
                required 
                className="mt-1 block w-full px-4 py-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
                placeholder="Enter your email"
              />
            </div>
            <div>
              <label htmlFor="password" className="block text-base font-medium text-gray-700">Password</label>
              <input 
                type="password" 
                name="password" 
                onChange={onChange} 
                required 
                className="mt-1 block w-full px-4 py-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
                placeholder="Enter your password"
              />
            </div>
            <div>
              <button 
                type="submit" 
                className="w-full flex justify-center py-3 px-4 border border-transparent rounded-lg shadow-lg text-lg font-bold text-white bg-gradient-to-r from-blue-600 to-indigo-700 hover:from-blue-700 hover:to-indigo-800 transition-all duration-300 ease-in-out"
              >
                Sign In to NeuroAssess
              </button>
            </div>
          </form>

          <p className="text-center text-gray-500 mt-8 text-sm max-w-sm mx-auto lg:mx-0">
            Need assistance? <Link to="/signup" className="font-semibold text-indigo-600 hover:text-indigo-800">Sign Up</Link> if you don't have an account.
          </p>
        </div>

      </div>
    </div>
  );
};

export default LoginPage;
